import React from 'react';
import Card from './Card'




const CardList = ({robots}) =>{


	return (
		<div>
		{
	robots.forEach(item =>{
		return (
		<Card  key={item} 
		id ={robots[item].id} 
		name = {robots[item].name} 
		email={robots[item].email}
		/>
	);

	})
}


	</div>
		);
}


export default CardList;
